import React from 'react';

function App() {

  const onSubmit = ()=>{
    alert('submitted');
  }

  const onKeyUp = (e)=>{
    if(e.keyCode === 13){
      onSubmit();
    }
  }

  return (

    <div className="App">
      <input onKeyUp = {onKeyUp} type="text"/>
      <button onClick={onSubmit}> Submit</button>
    </div>

  );
}

export default App;
